/**
 * platforms: iPhone, iPad
 * @namespace <p>You use a <code>RefreshControl</code> with a {@link Ti.UI.TableView} or {@link Ti.UI.ListView} object.
It provides an alternate method to implement <strong>pull to refresh</strong> functionality provided by 
{@link Ti.UI.TableView.headerPullView} and {@link Ti.UI.ListView.pullView} properties.</p>
<p>Use the {@link Ti.UI.createRefreshControl} method to create a RefreshControl.</p>
 * 
 * @example Basic Pull To Refresh
 * <p>A basic sample showing the usage of refreshstart event with endRefreshing functionality.</p>
<pre><code>var win = Ti.UI.createWindow({
    fullscreen:true
});
var counter = 0;
function genData()
{
    var data = [];
    var i=1;
    for (i=1;i&lt;=3;i++) {
        data.push({properties:{title:'ROW '+(counter+i)}})
    }
    counter += 3;
    return data;
}
var section = Ti.UI.createListSection();
section.setItems(genData());
var control = Ti.UI.createRefreshControl({
    tintColor:'red'
})
var listView = Ti.UI.createListView({
    sections:[section],
    refreshControl:control
});
control.addEventListener('refreshstart',function(e){
    Ti.API.info('refreshstart');
    setTimeout(function(){
        Ti.API.debug('Timeout');
        section.appendItems(genData());
        control.endRefreshing();
    }, 2000);
})
win.add(listView);
win.open();
</code></pre>
 */
