/**
 * platforms: Android, BlackBerry, iPhone, iPad, Mobile Web, Tizen
 * @namespace <p>The appearance of a <code>Switch</code> control varies by platform: </p>
<ul>
<li>
<p>On Android, a Switch object can be styled either as a checkbox or 
toggle button (see {@link Ti.UI.Switch.style}). The checkbox style
can optionally display a label next to the control.</p>
</li>
<li>
<p>On iOS, a Switch appears as an iOS on/off switch and doesn't have any text associated with it. </p>
</li>
<li>
<p>On Mobile Web and Tizen, a switch always has text associated with it, and appears as a toggle button, 
similar to Android.</p>
</li>
</ul>
<p>Use the {@link Ti.UI.createSwitch} method or <strong><code><Switch></code></strong> Alloy element to create a switch.</p>
 * 
 * @example Simple Switch Example
 * <p>Create a standard switch, using default values, and output value property on each <code>change</code> 
event.</p>
<pre><code>var win = Ti.UI.createWindow({
  backgroundColor: 'white'
});

var basicSwitch = Ti.UI.createSwitch({
  value:true // mandatory property for iOS 
});
win.add(basicSwitch);

basicSwitch.addEventListener('change',function(e){
  Ti.API.info('Switch value: ' + basicSwitch.value);
});

win.open();

// print initial value
Ti.API.info('Switch value: ' + basicSwitch.value);
</code></pre>
 * 
 * @example Toggle Button Switch Example (Android)
 * <p>Create a standard (toggle button) switch with a customized title for each on/off state, and 
output value property on each <code>change</code> event.</p>
<pre><code>var win = Ti.UI.createWindow({
  backgroundColor: 'white'
});

var basicSwitch = Ti.UI.createSwitch({
  titleOn:'Notifications Enabled',
  titleOff:'Notifications Disabled',
  value:true,
  width: 200, height:120
});
win.add(basicSwitch);

basicSwitch.addEventListener('change',function(e){
  Ti.API.info('Switch value: ' + basicSwitch.value);
});

win.open();
</code></pre>
 * 
 * @example Checkbox Switch Example (Android)
 * <p>Create a checkbox switch, and output value property on each <code>change</code> event.</p>
<pre><code>var win = Ti.UI.createWindow({
  backgroundColor: 'white'
});

var basicSwitch = Ti.UI.createSwitch({
  style: Ti.UI.Android.SWITCH_STYLE_CHECKBOX,
  textAlign:Ti.UI.TEXT_ALIGNMENT_CENTER,
  title:'Notifications',
  value:true,
  width: 300 // necessary for textAlign to be effective
});
win.add(basicSwitch);

basicSwitch.addEventListener('change',function(e){
  Ti.API.info('Switch value: ' + basicSwitch.value);
});

win.open();
</code></pre>
 * 
 * @example Alloy XML Markup
 * <p>Previous simple switch example as an Alloy view.</p>
<p>switchexample.xml:</p>
<pre><code>&lt;Alloy&gt;
    &lt;Window id="win" backgroundColor="white"&gt;
        &lt;Switch id="basicSwitch" value="true" onChange="outputState"/&gt;
    &lt;/Window&gt;
&lt;/Alloy&gt;
</code></pre>
<p>switchexample.js:</p>
<pre><code>function outputState(){
    Ti.API.info('Switch value: ' + $.basicSwitch.value);
}
</code></pre>
 */
